The Battle of Midway (NG)

War Documentary hosted by Nicholas Rowe, published by National Geographic broadcasted as part of NG Generals at War series in 2009 - English narration


Information
------------------------------

Considered the most important battle in the pacific during WW2, an examination of the battle tactics of Japanese Adm. Chuichi Nagumo and U.S. Adm. Jack Fletcher. A look at Japan's little mistakes cost them the battle, and how the US forces nearly lost the battle.

